%[text] Voci un code pour calculer la série de Fourier numériquement, (coefficients numériques aussi). \[Code fait avec chatGPT, vérifier erreur possible\]
clf; clear;
% ------------------------
% Paramètres utilisateur
% ------------------------
f = @(x) exp(cos(x)); % Choisis ta fonction ici (doit être définie sur [-pi, pi])
N_list = [3, 5, 10, 30];  % Valeurs de N à comparer
x = linspace(-pi, pi, 1000);  % Grille d'évaluation

K = length(N_list);
M = length(x);

% ------------------------
% Préparation
% ------------------------
F_true = f(x(:));  % Valeur réelle de f
F_approx = zeros(M, K);  % Approximations pour chaque N

% ------------------------
% Boucle sur chaque N
% ------------------------
for k = 1:K
    N = N_list(k);
    
    % Coefficients a_0, a_n, b_n
    a0 = (1/pi) * integral(@(t) f(t), -pi, pi);
    an = zeros(1, N);
    bn = zeros(1, N);
    
    for n = 1:N
        an(n) = (1/pi) * integral(@(t) f(t) .* cos(n*t), -pi, pi);
        bn(n) = (1/pi) * integral(@(t) f(t) .* sin(n*t), -pi, pi);
    end
    
    % Approximation de f_N(x)
    fN = a0 / 2 * ones(size(x));
    for n = 1:N
        fN = fN + an(n) * cos(n*x) + bn(n) * sin(n*x);
    end
    
    F_approx(:, k) = fN(:);
end

% Tracé de la fonction réelle
figure; hold on; %[output:17867cd2]
plot(x, F_true, 'k-', 'LineWidth', 2.5);  % f(x) = courbe noire épaisse %[output:17867cd2]

% Palette de couleurs bien espacées
colororder = lines(K);  % palette claire et distincte
linestyles = {'--', '-.', ':', '-.', '-', ':'};  % varier les styles si nécessaire

% Tracé des approximations de Fourier
for k = 1:K
    lw = 1.0 + 0.3 * k;  % épaisseur croissante
    plot(x, F_approx(:, k), ... %[output:17867cd2]
         'Color', colororder(k, :), ... %[output:17867cd2]
         'LineStyle', linestyles{mod(k-1, length(linestyles)) + 1}, ... %[output:17867cd2]
         'LineWidth', lw); %[output:17867cd2]
end

% Légende et étiquettes
legend_entries = ["f(x)"];
for k = 1:K
    legend_entries(end+1) = sprintf("N = %d", N_list(k));
end
legend(legend_entries, 'Location', 'southeast'); %[output:17867cd2]
xlabel('x'); ylabel('f_N(x)'); %[output:17867cd2]
title('Approximation par séries de Fourier pour différents N'); %[output:17867cd2]
grid on; %[output:17867cd2]

% Amélioration du rendu visuel
set(gca, 'FontSize', 12); %[output:17867cd2]
axis tight; %[output:17867cd2]
% saveas(gcf, 'FourierX.png')
% ------------------------
% Calcul de l'erreur quadratique pour chaque N
% ------------------------
error_L2 = zeros(1, K);
dx = (2*pi) / M;

for k = 1:K
    diff = F_true - F_approx(:, k);
    error_L2(k) = sqrt( dx * sum(diff.^2) );
end

% Affichage des erreurs
disp('Erreur L^2 pour chaque N :'); %[output:2d283756]
norm_f = sqrt( dx * sum(F_true.^2) );
error_rel = error_L2 / norm_f;

for k = 1:K %[output:group:94894b68]
    fprintf('N = %3d : erreur absolue = %.3e, relative = %.3e\n', ... %[output:2bfc3c55]
        N_list(k), error_L2(k), error_rel(k)); %[output:2bfc3c55]
end %[output:group:94894b68]

figure; %[output:2f1b0810]
semilogy(N_list, error_L2, '-o', 'LineWidth', 2); %[output:2f1b0810]
xlabel('N'); %[output:2f1b0810]
ylabel('Erreur L^2'); %[output:2f1b0810]
title('Erreur quadratique vs N'); %[output:2f1b0810]
grid on; %[output:2f1b0810]






